import React, {Component} from 'react';

class Home extends Component {
    render() {
        return (

               <div className="mainContent">
                   <div id="title">
                       <h1>English to German Translator</h1>
                   </div>
                   <div id="buttons">
                   <button className="btn-primary">Launch</button>
                   <button className="btn-primary">Evaluate</button>
                   <button className="btn-primary">Reverse Phrase Order</button>
                   <button className="btn-primary">Set Epochs</button>
                   </div>
                   <p>Display Output:</p>
                   <div id="content">

                   </div>
               </div>

        );
    }
}

export default Home;
